import { Box } from 'grommet';
import { Notification } from 'grommet-icons';

class TopActionBar extends React.Component{
    constructor(props) {
        super(props);

        this.state = {
        };
    }

    render(){
        return(<Box
            border={{
                "color": "border",
                "size": "medium",
                "style": "dashed",
                "side": "all"
              }}
        >
            <h1>Hi I am top action bar component</h1>
        </Box>)
    }
}

export default TopActionBar;
